  /* All objects have a 'this' attribute */
  this_descr = PyDescr_NewGetSet(SwigPyObject_type(), &this_getset_def);
  (void)this_descr;
  
  /* All objects have a 'thisown' attribute */
  thisown_descr = PyDescr_NewGetSet(SwigPyObject_type(), &thisown_getset_def);
  (void)thisown_descr;
  
  public_interface = PyList_New(0);
  public_symbol = 0;
  (void)public_symbol;
  
  PyDict_SetItemString(md, "__all__", public_interface);
  Py_DECREF(public_interface);
  for (i = 0; SwigMethods[i].ml_name != NULL; ++i)
  SwigPyBuiltin_AddPublicSymbol(public_interface, SwigMethods[i].ml_name);
  for (i = 0; swig_const_table[i].name != 0; ++i)
  SwigPyBuiltin_AddPublicSymbol(public_interface, swig_const_table[i].name);
#endif
  
  SWIG_InstallConstants(d,swig_const_table);
  
  SWIG_Python_SetConstant(d, "SHARED_PTR_DISOWN",SWIG_From_int(static_cast< int >(0)));
  SWIG_Python_SetConstant(d, "EVENTTYPE_MIN",SWIG_From_int(static_cast< int >(Mcsf::EVENTTYPE_MIN)));
  SWIG_Python_SetConstant(d, "EVENTTYPE_DISCONNECT",SWIG_From_int(static_cast< int >(Mcsf::EVENTTYPE_DISCONNECT)));
  SWIG_Python_SetConstant(d, "EVENTTYPE_CONNECT_ADDR",SWIG_From_int(static_cast< int >(Mcsf::EVENTTYPE_CONNECT_ADDR)));
  SWIG_Python_SetConstant(d, "EVENTTYPE_RECONNECT",SWIG_From_int(static_cast< int >(Mcsf::EVENTTYPE_RECONNECT)));
  SWIG_Python_SetConstant(d, "EVENTTYPE_MAX",SWIG_From_int(static_cast< int >(Mcsf::EVENTTYPE_MAX)));
  SWIG_Python_SetConstant(d, "IAsyncResult_ReceiveResponse",SWIG_From_int(static_cast< int >(Mcsf::IAsyncResult::ReceiveResponse)));
  SWIG_Python_SetConstant(d, "IAsyncResult_TimeOut",SWIG_From_int(static_cast< int >(Mcsf::IAsyncResult::TimeOut)));
  SWIG_Python_SetConstant(d, "IAsyncResult_TCPClose",SWIG_From_int(static_cast< int >(Mcsf::IAsyncResult::TCPClose)));
  SWIG_Python_SetConstant(d, "IAsyncResult_NotHandler",SWIG_From_int(static_cast< int >(Mcsf::IAsyncResult::NotHandler)));
  
